export default function Footer() {
  return (
    <footer className='footer-container pb-16 px-64 bg-slate-600 text-white font-primary'>
        <div className='max-w-screen-xl flex flex-wrap items-center justify-between mx-auto'>
            <div className='footer-newsletter'>
                <p className='font-semibold text-base'>Subscribe to our newsletter!</p>

            </div>
            <div className='footer-links'>
                <p className='text-sm font-semibold'>Our Links</p>
            </div>
        </div>
    </footer>
  );
}
